INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEKE', 'STOCK', 'KE Holdings Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'KE Holdings Inc is a holding company mainly engaged in housing transactions and related services. The Company operates in four segments. The Existing Home Transaction Services segment mainly provides agency services to sales or leases of existing homes, and platform and franchise services to brokerage firms on Beike platform, as well as other transaction services. The New Home Transaction Services segment mainly provides new home transaction and agency services to real estate developers. The Home Renovation and Furnishing segment provides a one-stop solution to give housing customers access to a comprehensive range of home renovation and furnishing, ranging from interior design, renovation, re-modeling, furnishing, supplies, to after-sales maintenance and repair. The Emerging and Other Services segment is engaged in rental property management service business, financial service business and others.', 'Beijing, , China', 135072);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDIT', 'STOCK', 'Editas Medicine, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Editas Medicine, Inc. is a genome-editing company developing potentially transformative genomic medicines to treat a broad range of serious diseases. It has developed a proprietary gene editing platform based on CRISPR technology that includes CRISPR/Cas9, CRISPR/Cas12a, engineered forms and foundational intellectual property for both CRISPR systems. CRISPR uses a protein-RNA complex composed of an enzyme, including either Cas9 (CRISPR-associated protein 9) or Cas12a (CRISPR from Prevotella and Francisella 1, also known as Cpf1), bound to a guide RNA molecule designed to recognize a particular DNA sequence. It is engaged in discovering, developing, manufacturing, and commercializing durable, precision in vivo gene-editing medicines for a broad class of diseases. Vivo medicines include vivo editing of hematopoietic stem cells (HSCs), liver cells and other tissues. Vivo gene editing in HSCs supports the advancement of research programs to treat non-malignant hematological diseases.', 'Cambridge, MA, United States', 246);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAL', 'STOCK', 'Delta Air Lines, Inc.', 'NYQ', 'Industrials', 'Airlines', 'A Delta Air Lines, Inc. Fornece transporte aéreo regular para passageiros e cargas em todos os Estados Unidos e em todo o mundo. A empresa tem hubs e mercados em Amsterdã, Atlanta, Bogotá, Boston, Detroit, Lima, London-Heathrow, Los Angeles, Cidade do México, Minneapolis-St. Paulo, New York-JFK and LaGuardia, Paris-Charles de Gaulle, Salt Lake City, Santiago (Chile), São Paulo, Seattle, Seul-Incheon, e Tóquio. Seus segmentos incluem Companhia Aérea e Refinaria. Seu segmento de companhias aéreas é gerenciado como uma única unidade de negócios que fornece transporte aéreo regular para passageiros e cargas em todo os Estados Unidos e em todo o mundo e inclui seu programa de fidelidade, bem como outros negócios auxiliares. Seu segmento de refinaria opera para o benefício do segmento de companhias aéreas, fornecendo combustível a jato para o segmento de companhias aéreas a partir de sua própria produção e por meio de combustível a jato obtido por meio de acordos com terceiros. A produção da', 'Atlanta, GA, United States', 103000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDNS', 'STOCK', 'Cadence Design Systems, Inc.', 'NMS', 'Technology', 'Software - Application', 'Cadence Design Systems, Inc. É uma empresa de design de sistemas eletrônicos. A Empresa aplica sua estratégia de Design Inteligente de Sistemas para entregar software, hardware e propriedade intelectual (IP) que transformam conceitos de design em realidade. Suas categorias de produtos incluem Core Electronic Design Automation (EDA), Semicondutor IP e System Design and Analysis (SD&A). O EDA do núcleo inclui software, hardware e serviços usados para projetar e verificar uma grande variedade de semicondutores. O portfólio de semicondutores IP inclui subsistemas de silício, software e serviços que são usados no projeto de semicondutores. A categoria SD&A inclui o software e os serviços utilizados para projetar e verificar uma grande variedade de sistemas eletrónicos físicos. Seus semicondutores são usados em vários setores, incluindo automotivo, aeroespacial, biotecnologia, hiperescala e computação em nuvem, data centers, telecomunicações, tecnologia médica, Internet das Coisas industrial', 'San Jose, CA, United States', 13152);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRSP', 'STOCK', 'CRISPR Therapeutics AG', 'NGM', 'Healthcare', 'Biotechnology', 'A CRISPR Therapeutics AG é uma empresa de edição de genes sediada na Suíça focada no desenvolvimento de terapias baseadas em CRISPR/Cas9. CRISPR/Cas9 significa Clustered Regularly Interspaced Short Palindromic Repeats (CRISPR)/CRISPR-associated protein 9 (Cas9) e é uma tecnologia para edição de genes, o processo de alterar com precisão sequências específicas de DNA genômico. A Companhia tem como objetivo aplicar essa tecnologia para interromper, excluir, corrigir e inserir genes para tratar doenças geneticamente definidas e projetar terapias celulares avançadas. A Companhia adquiriu os direitos sobre a propriedade intelectual (PI) que abrange CRISPR/Cas9 e tecnologias relacionadas e também está envolvida em sua própria pesquisa de PI e esforços adicionais de licenciamento. As estratégias de parceria e desenvolvimento de produtos da Companhia são projetadas para explorar todo o potencial da plataforma CRISPR/Cas9, maximizando a probabilidade de desenvolver com sucesso seus produtos-cand', 'Zug, , Switzerland', 393);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVX', 'STOCK', 'Chevron Corporation', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Chevron Corporation é uma empresa de energia integrada. A empresa produz petróleo bruto e gás natural; fabrica combustíveis de transporte, lubrificantes, petroquímicos e aditivos; e desenvolve tecnologias que aprimoram nossos negócios e a indústria. As operações de upstream da Companhia consistem principalmente em explorar, desenvolver, produzir e transportar petróleo bruto e gás natural; liquefação, transporte e regaseificação associados ao gás natural liquefeito (GNL); transportar petróleo bruto pelos principais oleodutos internacionais de exportação de petróleo; processamento, transporte, armazenamento e comercialização de gás natural; captura e armazenamento de carbono; e uma planta de gás para líquidos. As operações a jusante da Companhia consistem principalmente na refinação de petróleo bruto em produtos petrolíferos; comercialização de petróleo bruto, produtos refinados e lubrificantes; fabricação e comercialização de combustíveis renováveis; transporte de petróleo bruto e pro', 'Houston, TX, United States', 45298);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUK', 'STOCK', 'Carnival Corporation & plc', 'NYQ', 'Consumer Cyclical', 'Travel Services', 'Carnival PLC is a global cruise company. The Companys segments include North America and Australia (NAA) cruise operations, Europe and Asia (EA) cruise operations, Cruise Support, and Tour and Other. NAA cruise operations include Carnival Cruise Line, Princess Cruises, Holland America Line, P&O Cruises (Australia), and Seabourn. The EA segment includes Costa Cruises (Costa), AIDA Cruises (AIDA), P&O Cruises (UK) and Cunard. Cruise Support segment includes its portfolio of port destinations and other services, all of which are operated for the benefit of its cruise brands. Tour and Other segment represent the hotel and transportation operations of Holland America Princess Alaska Tours and other operations. Holland America Princess Alaska Tours is a tour company in Alaska and the Canadian Yukon, which complements its Alaska cruise operations. The Companys cruising offers a broad range of products and services to suit vacationing guests.', 'Miami, FL, United States', 115000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APA', 'STOCK', 'APA Corporation', 'NMS', 'Energy', 'Oil & Gas E&P', 'A APA Corporation é uma empresa independente de energia. A Companhia possui subsidiárias que exploram e produzem petróleo e gás natural nos Estados Unidos, Egito e Reino Unido, e que exploram petróleo e gás natural no Suriname. O negócio de upstream da Companhia possui operações de petróleo e gás em três áreas geográficas: Estados Unidos, Egito e offshore no Reino Unido no Mar do Norte (Mar do Norte). Também tem operações ativas de exploração e avaliação em andamento no Suriname, bem como interesses no Uruguai e em outros locais internacionais. Mantém um portfólio diversificado de ativos, incluindo interesses convencionais e não convencionais, onshore e offshore, exploração e produção de petróleo e gás natural. Nos Estados Unidos, as operações são focadas principalmente na Bacia Permiana do Oeste do Texas e Leste do Novo México, com operações adicionais localizadas nas áreas de xisto Eagle Ford e Austin Chalk do Sudeste do Texas, offshore no Golfo do México e ao longo da Costa do Golfo', 'Houston, TX, United States', 2305);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BP', 'STOCK', 'BP p.l.c.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A BP p.l.c. é uma empresa de energia integrada com sede no Reino Unido. Os segmentos da empresa incluem gás e energia de baixo carbono, produção e operações de petróleo, clientes e produtos e outras empresas e empresas. Seu negócio de gás inclui regiões com atividades a montante que produzem gás natural, gás e energia integrados e comércio de gás. Seu negócio de baixo carbono inclui energia solar, offshore e onshore, captura e armazenamento de hidrogênio e carbono e comércio de energia. O segmento de produção e operações de petróleo compreende regiões com atividades a montante que produzem predominantemente petróleo bruto, incluindo energia bpx. O segmento Clientes & Produtos compreende os seus negócios focados no cliente, que incluem a conveniência e combustíveis de retalho, carregamento de veículos elétricos, bem como Castrol, aviação e negócios para empresas e midstream. Também inclui seus negócios de produtos, refino e comércio de petróleo, bem como seus negócios de bioenergia. Out', 'London, , United Kingdom', 100500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRDF', 'STOCK', 'Cardiff Oncology, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cardiff Oncology, Inc. is a clinical-stage biotechnology company. It is leveraging PLK1 inhibition, a well-validated oncology drug target, to develop novel therapies across a range of cancers with unmet medical need. It is focused on clinical programs in indications, such as RAS-mutated metastatic colorectal cancer (mCRC), and in investigator-initiated trials in metastatic pancreatic ductal adenocarcinoma (mPDAC), small cell lung cancer (SCLC), and triple negative breast cancer (TNBC). Its lead drug candidate, Onvansertib, is an oral, small-molecule drug candidate that is highly specific for PLK1 inhibition with a 24-hour half-life. It has other ongoing and planned clinical trials of onvansertib: one trial (CRDF-004) in first-line treatment in patients with RAS-mutated mCRC, and investigator-initiated trials in first-line mPDAC, relapsed SCLC and unresectable locally advanced or metastatic TNBC.', 'San Diego, CA, United States', 32);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBRE', 'STOCK', 'CBRE Group, Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'CBRE Group, Inc. É uma empresa comercial de serviços imobiliários e investimento. Seu segmento de Serviços de Consultoria oferece uma gama de serviços globalmente, incluindo locação de imóveis; mercados de capitais, que incluem vendas de imóveis e originação de hipotecas; serviços de hipoteca; gestão e avaliação de propriedades. Seu segmento Global Workplace Solutions oferece soluções integradas de gerenciamento de instalações e gerenciamento de projetos para grandes ocupantes de imóveis comerciais. O seu segmento de Investimentos Imobiliários é composto por dois negócios: Gestão de investimentos e desenvolvimento imobiliário. Os seus serviços de gestão de investimentos são prestados a fundos de pensões, companhias de seguros, fundos soberanos, fundações, dotações, fundos de investimento, e outros investidores institucionais. Seus serviços de desenvolvimento consistem em atividades de desenvolvimento imobiliário e investimento. Ele fornece serviços de engenharia, operações de suporte b', 'Dallas, TX, United States', 140000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SG', 'STOCK', 'Sweetgreen, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Sweetgreen, Inc. is a restaurant and lifestyle brand that serves healthy food at scale. The Company has designed its menu to be customizable and convenient to empower its customers to make healthier choices for both lunch and dinner. The Company''s core menu features approximately 13 signature items which are offered year-round in all of its locations, including its new steak plate. In addition to its core menu items, its single most popular item is the custom salad or bowl, which can include combinations from 40-plus ingredients as well as its made-from-scratch dressings. On its Owned Digital Channels, it offers exclusive menu items, including seasonal digital exclusives and collections relevant to each customer. It has a five-channel model that is designed to help its customers to order. The Company''s five-channel model includes Pick-Up, Native Delivery, Outpost and Catering, In-Store, and Marketplace. It has approximately 250 restaurants across the country.', 'Los Angeles, CA, United States', 6407);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLVT', 'STOCK', 'Clarivate Plc', 'NYQ', 'Technology', 'Information Technology Services', 'Clarivate Plc is a global provider of transformative intelligence. The Company offers enriched data, insights and analytics, workflow solutions and expert services in the areas of Academia & Government (A&G), Intellectual Property (IP) and Life Sciences & Healthcare (LS&H). Within the A&G segment, the Company provides research and analytics, content aggregation, and workflow software solutions. Within the IP segment, the Company provides IP Maintenance, IP Intelligence, and IP Management solutions. Within the LS&H segment, the Company provides research and development, regulatory and safety, and commercialization solutions. It is also a provider of cloud-based solutions that enable life sciences clients to automate regulatory reporting and compliance management. It is also engaged in providing comprehensive and integrated solutions to support patent preparation, filing and prosecution, offering patent practitioners with automation and artificial intelligence (AI)-enabled solutions.', 'London, , United Kingdom', 12000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALT', 'STOCK', 'Altimmune, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Altimmune, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing next-generation peptide-based therapeutics. It is developing pemvidutide, a GLP-1/glucagon dual receptor agonist for the treatment of obesity, metabolic dysfunction-associated steatohepatitis (MASH) and other indications. Activation of the GLP-1 and glucagon receptors is believed to mimic the complementary effects of diet and exercise on weight loss, with GLP-1 suppressing appetite and glucagon increasing energy expenditure. Glucagon is also recognized as having direct effects on hepatic fat metabolism, to rapid reductions in levels of liver fat and serum lipids. The Company has completed the MOMENTUM Phase II obesity trial and is being studied in the IMPACT Phase IIb MASH trial. The Company also develops and commercializes surfactant-functionalized (EuPort domain) incretin-based peptide therapeutics, including (GLP-1-glucagon)/oxyntomodulin, and variants.', 'Gaithersburg, MD, United States', 59);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIS', 'STOCK', 'The Walt Disney Company', 'NYQ', 'Communication Services', 'Entertainment', 'A Walt Disney Company é uma empresa de entretenimento diversificada em todo o mundo. Os segmentos da empresa incluem entretenimento, esportes e experiências. O segmento de Entretenimento geralmente engloba suas atividades de produção e distribuição de conteúdo episódico e filmes globais não esportivos. As linhas de negócios dentro do segmento de Entretenimento, juntamente com suas atividades de negócios, incluem redes lineares, direto para o consumidor e vendas/licenciamento de conteúdo. O segmento de Esportes engloba suas atividades de produção e distribuição de conteúdo de transmissão de vídeo direto para o consumidor (DTC). As linhas de negócios dentro do segmento de Esportes incluem ESPN e Star. O segmento Experiências inclui Parques e Experiências e Produtos de Consumo. Parques e Experiências consiste em Walt Disney World Resort na Flórida, Disneyland Resort na Califórnia, Disney Cruise Line e outros. Os produtos de consumo incluem o licenciamento de seus nomes comerciais, persona', 'Burbank, CA, United States', 177080);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEG', 'STOCK', 'Aegon Ltd.', 'NYQ', 'Financial Services', 'Insurance - Diversified', 'Aegon Ltd. (Aegon) é uma holding internacional de serviços financeiros. A empresa oferece produtos e serviços em seguros, economias de longo prazo, bancos e gestão de ativos. Nos Estados Unidos, a empresa opera sob duas marcas: Transamerica e World Financial Group Insurance Agency, que oferece seguros de vida, investimentos e soluções de aposentadoria. Na Holanda, a Aegon se concentra em seguros de vida, economias de longo prazo, soluções de pensão e anuidade e hipotecas. No Reino Unido, a Aegon é a plataforma de investimento, fornecendo uma gama de investimentos, soluções de aposentadoria e produtos de proteção para indivíduos, consultores e empregadores. Na China, a empresa possui uma participação na Aegon THTF Life Insurance Company, que oferece soluções de seguro de vida através de uma rede de filiais, principalmente no leste da China. Conta ainda com uma parceria com o Banco Santander para distribuir produtos de seguros de vida, saúde e não vida através das agências do banco em Es', 'The Hague, , Netherlands', 15582);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYH', 'STOCK', 'Community Health Systems, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Community Health Systems, Inc. is a healthcare company. The Companys affiliates are providers of healthcare services, developing and operating healthcare delivery systems in approximately 35 distinct markets across 14 states. The Company''s subsidiaries own or lease 70 affiliated hospitals with more than 10,000 beds and operate more than 1,000 sites of care, including physician practices, urgent care centers, freestanding emergency departments, occupational medicine clinics, imaging centers, cancer centers and ambulatory surgery centers. Its hospitals and other sites of care offer a variety of inpatient and outpatient medical and surgical services. These include general acute care, emergency room, general and specialty surgery, critical care, internal medicine, obstetrics, diagnostic services, psychiatric and rehabilitation services. In addition, some of its hospitals provide skilled nursing and home care services based on individual community needs.', 'Franklin, TN, United States', 45000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CONL', 'STOCK', 'GraniteShares 2x Long COIN Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund aims to generate 2 times the daily performance of the underlying stock for a single day. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EW', 'STOCK', 'Edwards Lifesciences Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'A Edwards Lifesciences Corporation é a empresa global de coração estrutural. A empresa faz parceria com médicos e pesquisadores e investe em pesquisa e desenvolvimento para melhorar o atendimento aos impactados por doenças cardíacas estruturais. Suas categorias de produtos incluem a Substituição da Válvula Aórtica Transcateter (TAVR), as terapias mitral e tricúspide transcateter (TMTT) e o Coração Estrutural Cirúrgico. Ele fornece tecnologias de substituição de válvulas cardíacas transcatetadas projetadas para a substituição minimamente invasiva de válvulas cardíacas aórticas. A categoria TAVR inclui os sistemas EDWARDS SAPIEN 3, EDWARDS SAPIEN 3 Ultra e EDWARDS SAPIEN 3 Ultra RESILIA. A categoria TMTT inclui o sistema de reparação transcateter Pascal Precision, o sistema de substituição da válvula tricúspide EVOQUE e o sistema de reconstrução da válvula tricúspide Cardioband. Sua válvula aórtica INSPIRIS RESILIA, oferece tecido RESILIA e tecnologia VFit. É gerido em várias regiões geo', 'Irvine, CA, United States', 15800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BORR', 'STOCK', 'Borr Drilling Limited', 'NYQ', 'Energy', 'Oil & Gas Drilling', 'Borr Drilling Limited is an offshore shallow-water drilling contractor providing offshore drilling services to the oil and gas industry. The Company''s primary business is the ownership, contracting and operation of jack-up rigs for operations in shallow-water areas (in water depths up to approximately 400 feet), including the provision of related equipment and work crews to conduct oil and gas drilling and workover operations for exploration and production customers. It owns approximately 22 rigs with an additional two jack-up rigs. Its rigs include Skald, Groa, Idun, Thor, Norve, Gerd, Natt, Ran, Odin, Gersemi, Grid, Galar, Njord, Prospector 1, Saga, Prospector 5, Mist, Gunnlod, Frigg, Gyme, Arabia I, and Arabia II. It operates oil-producing geographies throughout the world, including the North Sea, Mexico, West Africa, Southeast Asia, and the Middle East. The Company contracts its jack-up rigs primarily on a daily rate basis to drill wells for its customers.', 'Hamilton, , Bermuda', 2087);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNDX', 'STOCK', 'Vanguard Total International Bond Index Fund', 'NGM', NULL, NULL, 'The fund employs an indexing investment approach designed to track the performance of the Bloomberg Global Aggregate ex-USD Float Adjusted RIC Capped Index (USD Hedged). This index provides a broad-based measure of the global, investment-grade, fixed-rate debt markets. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPB', 'STOCK', 'The Campbell''s Company', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'A Campbell''s Company, anteriormente Campbell Soup Company, oferece alimentos e bebidas acessíveis. A empresa está focada na potência da marca, em duas divisões: Refeições e bebidas e lanches. O portfólio da Companhia de aproximadamente 16 marcas inclui Campbell''s, Cape Cod, Chunky, Goldfish, Kettle Brand, lance, Tarde de de de Julho, Pace, Pacific Foods, Pepperidge Farm, Pretzel Crisps, Snyder''s de Hanover, Swanson e V8. Oferece comida nutritiva e conveniente para famílias canadenses. Sua divisão norte-americana Foodservice oferece alimentos, receitas e soluções sob medida para uma ampla gama de segmentos, incluindo instalações de saúde, restaurantes e cafés especiais, escolas, vending e micro-mercados, e hospedagem em toda a América do Norte. Pacific Foods é um produtor de caldo orgânico e sopa. Oferecendo uma ampla gama de opções orgânicas e vegetais saborosas, as sopas incluem pimenta vermelha assada cremosa e tomate e novas sopas enlatadas prontas a servir.', 'Camden, NJ, United States', 14400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHR', 'STOCK', 'Danaher Corporation', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'A Danaher Corporation é uma inovadora global em ciências da vida e diagnósticos. A Companhia atua através de três segmentos: Biotecnologia, Ciências da Vida e Diagnóstico. O segmento de Biotecnologia inclui os negócios de bioprocessamento e descoberta e medicina e oferece uma ampla gama de equipamentos, consumíveis e serviços que são utilizados principalmente pelos clientes para avançar e acelerar a pesquisa, desenvolvimento, fabricação e entrega de medicamentos biológicos. O segmento de Ciências da Vida oferece uma ampla gama de instrumentos, consumíveis, serviços e software que são usados principalmente pelos clientes para estudar os blocos básicos da vida, incluindo ácido desoxirribonucleico (DNA) e ácido ribonucleico (RNA), ácido nucleico, proteínas, metabólitos e células. O segmento de Diagnóstico oferece instrumentos clínicos, consumíveis, software e serviços que hospitais, consultórios médicos, laboratórios de referência e outras configurações de cuidados críticos usam para diag', 'Washington, DC, United States', 61000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRBU', 'STOCK', 'Caribou Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Caribou Biosciences, Inc. is a clinical-stage clustered regularly interspaced short palindromic repeats (CRISPR) genome-editing biopharmaceutical company engaged in developing transformative therapies for patients with devastating diseases. The Companys genome-editing platform, including its Cas12a chRDNA technology, enables superior precision to develop cell therapies that are armored to potentially improve activity against disease. Caribou is advancing a pipeline of off-the-shelf cell therapies from its CAR-T platform to offer broad access and rapid availability of treatments for patients with hematologic malignancies and autoimmune diseases. Its genome-editing platform, including its novel chRDNA technology, enables more precise genome editing of allogeneic cell therapies. It is advancing its pipeline of allogeneic CAR-T cell therapies with clinical development programs targeting the treatment of hematologic malignancies and autoimmune diseases.', 'Berkeley, CA, United States', 147);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSX', 'STOCK', 'Boston Scientific Corporation', 'NYQ', 'Healthcare', 'Medical Devices', 'A Boston Scientific Corporation é uma desenvolvedora, fabricante e comerciante global de dispositivos médicos que são usados em uma variedade de especialidades médicas intervencionistas. O segmento MedSurg da Empresa inclui Endoscopia, Urologia e Neuromodulação. Seu negócio de Endoscopia desenvolve e fabrica dispositivos para diagnosticar e tratar uma série de condições gastrointestinais com tecnologias menos invasivas. Seu negócio de urologia desenvolve e fabrica dispositivos para tratar várias condições urológicas para anatomias masculinas e femininas, incluindo pedras nos rins, hiperplasia prostática benigna, câncer de próstata, disfunção erétil, e incontinência. Seu negócio de Neuromodulação desenvolve e fabrica dispositivos para tratar vários distúrbios do movimento neurológico e gerenciar a dor crônica. Seu segmento Cardiovascular inclui Cardiologia e Intervenções Periféricas. A Cardiologia inclui terapias intervencionistas de cardiologia, vigia, gerenciamento do ritmo cardíaco e', 'Marlborough, MA, United States', 53000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIDU', 'STOCK', 'Baidu, Inc.', 'NMS', 'Communication Services', 'Internet Content & Information', 'Baidu Inc é um provedor de pesquisa na Internet em língua chinesa. A Companhia opera seus negócios por meio de dois segmentos, o segmento Baidu Core e o segmento iQIYI. O Baidu Core Segment fornece principalmente serviços de marketing on-line baseados em busca, feed-based e outros serviços de marketing on-line, bem como produtos e serviços das novas iniciativas de inteligência artificial (IA) da Empresa, como anúncios de exibição e baseados em critérios de desempenho que não sejam custo por clique, serviços de nuvem, dispositivos e serviços inteligentes, serviços voltados para o consumidor não marketing, como adesão e condução inteligente. O segmento iQIYI produz, agrega e distribui uma grande variedade de conteúdos produzidos profissionalmente, bem como um amplo espetro de outros conteúdos de vídeo, em uma variedade de formatos, incluindo uma variedade de produtos e serviços que abrangem vídeo on-line, jogos on-line, literatura on-line, quadrinhos e outros.', 'Beijing, , China', 35900);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAOI', 'STOCK', 'Applied Optoelectronics, Inc.', 'NGM', 'Technology', 'Communication Equipment', 'Applied Optoelectronics, Inc. is a vertically integrated provider of fiber-optic networking products. The Company designs and manufactures a range of optical communications products at varying levels of integration, from components, subassemblies, and modules to complete turn-key equipment. The Company also designs, manufactures, and integrates its own analog and digital lasers using the proprietary Molecular Beam Epitaxy (MBE) and Metal Organic Chemical Vapor Deposition (MOCVD) alternative processes for the fabrication of lasers. The Company manufactures lasers and laser components and performs research and development activities for laser component and optical module products. The Company offers its fiber-optic networking products, primarily for four networking end-markets, such as cable television, (CATV), Internet data center, telecommunications, (telecom), and fiber-to-the-home (FTTH). The Company has manufacturing facilities in Taipei, Taiwan and Ningbo, China.', 'Sugar Land, TX, United States', 3309);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COHR', 'STOCK', 'Coherent Corp.', 'NYQ', 'Technology', 'Scientific & Technical Instruments', 'Coherent Corp., specializing in materials, networking, and lasers, is a vertically integrated manufacturing company that develops, manufactures, and markets engineered materials, optoelectronic components and devices, and lasers for use in the industrial, communications, electronics, and instrumentation markets. Its segments include Networking, Materials and Lasers. The Networking segment leverages its compound semiconductor technology platforms and knowledge of end-user applications for its key end markets to deliver differentiated components and subsystems. The Materials segment includes engineered materials and optoelectronic devices, such as those based on zinc selenide (ZnSe), zinc sulfide (ZnS), gallium arsenide (GaAs), indium phosphide (InP), gallium antimonide (GaSb), and silicon carbide (SiC). The Lasers segment''s lasers and optics products serve industrial customers in semiconductor and display capital equipment, precision manufacturing, and aerospace & defense, and others.', 'Saxonburg, PA, United States', 26157);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENTG', 'STOCK', 'Entegris, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'A Entegris, Inc. É um fornecedor de materiais avançados e soluções de processo para as indústrias de semicondutores e outras de alta tecnologia (alta tecnologia). Os segmentos da empresa incluem Soluções de Materiais (MS), Controle de Microcontaminação (MC) e Manuseio Avançado de Materiais (AMH). O segmento MS fornece materiais consumíveis avançados, tais como pastas e almofadas de planarização mecânica química (CMP), materiais de deposição, químicos de processo e gases, limpeza formulada, etchants e outros materiais especiais. O segmento MC está envolvido na filtragem e purificação de químicos líquidos críticos e gases usados em processos de fabricação de semicondutores e outras indústrias de alta tecnologia. O segmento AMH protege materiais críticos durante a fabricação, transporte e armazenamento; incluindo produtos que monitoram, protegem, transportam e fornecem químicos líquidos críticos, wafers e outros substratos para um amplo conjunto de aplicações nos setores de semicondutores', 'Billerica, MA, United States', 8000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIW', 'STOCK', 'ACI Worldwide, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'ACI Worldwide, Inc. is a global payments technology company, delivers software solutions that power intelligent payments orchestration in real time to banks, billers, and merchants. The Company''s segments include Payment Software and Biller. Its Payment Software segment drives payments orchestration for banks and merchants. It provides payment solutions to large and mid-size banks globally for retail banking, digital, and other payment services. Its support of merchants globally includes Tier 1 and Tier 2 merchants (in-store and online), payment service providers, independent selling organizations, value-added resellers, and acquirers who service them. The Company''s Biller segment provides electronic bill presentment and payment services to companies operating in the consumer finance, insurance, healthcare, higher education, utility, government, mortgage, subscription provider, and telecommunications categories. The Company also provides fraud abuse protection to its Biller customers', 'Elkhorn, NE, United States', 3103);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBAY', 'STOCK', 'eBay Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'eBay Inc. é uma empresa de comércio global, que inclui a sua plataforma de mercado. As tecnologias e serviços da empresa são concebidos para dar aos compradores escolha e inventário relevante e permitir aos vendedores oferecer o seu inventário para venda, virtualmente a qualquer hora e em qualquer lugar. A Empresa desenvolve interfaces de utilizador, ferramentas de comprador, vendedor e desenvolvedor e processamento de transacções, base de dados e aplicações de rede que ajudam os seus utilizadores a completar transacções nos seus sites. As suas plataformas são acessíveis através de uma experiência on-line, dispositivos móveis iOS e Android e as suas interfaces de programação de aplicações (APIs). A Empresa opera através de segmentos como o Marketplace. Marketplace inclui o seu mercado online localizado em www.ebay.com, as suas contrapartidas localizadas e o seu conjunto de aplicações móveis.', 'San Jose, CA, United States', 11500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHWY', 'STOCK', 'Chewy, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Chewy, Inc. is an e-commerce business geared toward pet products and services. The Companys products consist of pet food and treats, pet supplies and pet medications, other pet-health products, and pet services. It serves its customers through its retail websites, and its mobile applications and focuses on delivering customer service, competitive prices, convenience, including Chewys Autoship subscription program, and a range of pet food, treats and supplies, and pet healthcare products and services. It partners with approximately 3,200 of the brands in the pet industry, and it creates and offers its own private brands. It owns a number of trademark registrations and applications in the United States and in foreign jurisdictions. These trademarks include American Journey, Blue Box Event, Careplus, Chewy, Chewy.com, Chewy Vet Care, Dr. Lyons, Frisco, Goody Box, Onguard, PetMD, PracticeHub, Tiny Tiger, True Acre Farms, Tylees, Vibeful, and The Zoo.', 'Plantation, FL, United States', 18000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGH', 'STOCK', 'Anghami Inc.', 'NCM', 'Communication Services', 'Entertainment', 'Anghami Inc is a United Arab Emirates based company that provides digital music entertainment technology platform in the Middle East and North Africa (MENA). The Company has catalog comprising more than 72 million songs and licensed content from Arabic labels, independent artists, and distributors, available for more than 75 million users. The Company also features music from the international labels such as Universal, Sony and Warner. The Company''s services are available in English, Arabic and French. It has offices in Beirut, Dubai, Cairo and Riyadh and operates in 16 countries across MENA.', 'Abu Dhabi, , United Arab Emirates', 186);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQN', 'STOCK', 'Algonquin Power & Utilities Corp.', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Algonquin Power & Utilities Corp. is a Canada-based diversified international generation, transmission, and distribution company. The Company is engaged in providing sustainable energy and water solutions through its portfolio of generation, transmission and distribution utility investments to over one million customer connections. The Company''s operations are organized across three business units, consisting of: the Regulated Services Group, which primarily owns and operates a portfolio of regulated electric, water distribution and wastewater collection and natural gas utility systems and transmission operations in the United States, Canada, Bermuda and Chile; the Hydro Group, consisting of the hydroelectric business, which is not being sold as a part of the Renewables sale; and the Corporate Group, which includes corporate and service companies as well as its investment in Atlantica.', 'Oakville, ON, Canada', 3786);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABT', 'STOCK', 'Abbott Laboratories', 'NYQ', 'Healthcare', 'Medical Devices', 'A Abbott Laboratories é uma empresa global de cuidados de saúde. O principal negócio da empresa é a descoberta, desenvolvimento, fabricação e venda de uma ampla e diversificada linha de produtos de saúde. Seus segmentos incluem produtos farmacêuticos estabelecidos, produtos diagnósticos, produtos nutricionais e dispositivos médicos. O segmento de Produtos Farmacêuticos Estabelecido está envolvido nas vendas internacionais de uma ampla linha de produtos farmacêuticos genéricos de marca. O segmento de produtos de diagnóstico está envolvido nas vendas mundiais de sistemas de diagnóstico e testes para bancos de sangue, hospitais, laboratórios comerciais e locais de testes de cuidados alternativos. O segmento de produtos nutricionais está envolvido nas vendas mundiais de uma ampla linha de produtos nutricionais adultos e pediátricos. O segmento de dispositivos médicos está envolvido nas vendas mundiais de gerenciamento de ritmo, eletrofisiologia, insuficiência cardíaca, vascular, coração es', 'North Chicago, IL, United States', 114000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTDR', 'STOCK', 'Bitdeer Technologies Group', 'NCM', 'Technology', 'Software - Application', 'Bitdeer Technologies Group is a technology company for blockchain. It provides computing solutions for customers. The Company handles processes involved in computing, such as equipment procurement, transport logistics, datacenter design and construction, and equipment management. It primarily operates three business lines, namely self-mining, hash rate sharing, and hosting. Self-mining refers to cryptocurrency mining for its own account, which allows it to directly capture the high appreciation potential of cryptocurrency. It offers two types of hash rate sharing solutions, namely Cloud Hash Rate and Hash Rate Marketplace. Through Cloud Hash Rate, the Company sells its hash rate to customers. It offers hash rate subscription plans at a fixed price and shares mining income with them under certain arrangements. Its hosting services offer customers one-stop mining rig hosting solutions encompassing deployment, maintenance, and management services for efficient cryptocurrency mining.', 'Singapore, , Singapore', 183);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COP', 'STOCK', 'ConocoPhillips', 'NYQ', 'Energy', 'Oil & Gas E&P', 'A ConocoPhillips é uma empresa de exploração e produção. Seu segmento do Alasca explora principalmente para, produz, transporta e comercializa petróleo bruto, gás natural e NGL. O segmento inferior de 48 consiste em operações localizadas nos 48 estados contíguos nos Estados Unidos e no Golfo do México. As operações canadenses consistem no desenvolvimento de areias petrolíferas de Surmont em Alberta, o jogo não convencional Montney rico em líquidos na Colúmbia Britânica e operações comerciais. O segmento Europa, Médio Oriente e Norte de África consiste em operações principalmente localizadas no setor norueguês do Mar do Norte, Mar da Noruega, Qatar, Líbia, Guiné Equatorial e operações comerciais e de terminação no Reino Unido. O segmento Ásia-Pacífico tem operações de exploração e produção na China, Malásia, Austrália e operações comerciais na China, Cingapura e Japão. Outro segmento internacional inclui interesses na Colômbia, bem como contingências associadas a operações anteriores em', 'Houston, TX, United States', 11700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLMZ', 'STOCK', 'BloomZ Inc.', 'NCM', 'Communication Services', 'Entertainment', 'BloomZ Inc is an audio producing and voice actor managing company. The Company operates its business through three divisions. Audio Production business provides comprehensive audio production services for animation and video games. VTuber Management business operates a VTuber, which is a virtual character (animated character) it creates by utilizing motion-capture technology for its streamers to provide their voice to stream real-time videos featuring human facial expressions and gestures, which can also communicate and interact with audiences through the chat function by embedding in live-streaming platforms. Voice Actor Workshop business provides professional and practical voice acting educational services through its voice actor workshops. The Company also manages and promotes talent and artists.', 'Tokyo, , Japan', 10);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPNG', 'STOCK', 'Coupang, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Coupang, Inc. is a technology company that provides retail, restaurant delivery, video streaming, and fintech services to customers around the world under brands, such as Coupang, Coupang Eats, Coupang Play, Farfetch, and Rocket Now. Through its AI cloud computing service as Coupang Intelligent Cloud (CIC), it enhances its services and operations and provides GPU-as-a-Service (GPUaaS), including to external parties. Its Product Commerce segment includes its core Korean retail (owned inventory) and marketplace offerings (third-party merchants) and Rocket Fresh, its fresh grocery offering, as well as advertising products associated with these offerings. Its Developing Offerings include Coupang Eats, its restaurant ordering and delivery service in Korea, Coupang Play, an online content streaming service in Korea, fintech, its retail operations in Taiwan, as well as advertising products associated with these offerings, and also include Farfetch, its global luxury fashion marketplace.', 'Seattle, WA, United States', 95000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDD', 'STOCK', '3D Systems Corporation', 'NYQ', 'Technology', 'Computer Hardware', '3D Systems Corporation provides comprehensive three-dimensional (3D) printing and digital manufacturing solutions, including 3D printers for plastics and metals, materials, software, and services, including maintenance, advanced manufacturing and applications engineering. The Companys segments include Healthcare Solutions and Industrial Solutions. The Healthcare Solutions segment serves industry verticals, including dental, medical devices, personalized health services and regenerative medicine. The Industrial Solutions segment serves industry verticals, including aerospace, defense, transportation and general manufacturing. The Company architects solutions specific to customers needs through a combination of materials, hardware platforms, software, professional services and advanced manufacturing. It markets its products and services through subsidiaries in North America and South America, Europe and the Middle East and Asia Pacific and Oceania.', 'Rock Hill, SC, United States', 1833);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DELL', 'STOCK', 'Dell Technologies Inc.', 'NYQ', 'Technology', 'Computer Hardware', 'A Dell Technologies Inc. Está envolvida na conceção, desenvolvimento, fabricação, marketing, venda, e apoiando uma ampla gama de soluções, produtos e serviços abrangentes e integrados. A Companhia atua por meio de dois segmentos: Infrastructure Solutions Group (ISG) e Client Solutions Group (CSG). Seu segmento de ISG permite a transformação digital do cliente da empresa com soluções que abordam inteligência artificial (IA), aprendizado de máquina, análise de dados e ambientes de várias nuvens. Seu portfólio abrangente de armazenamento inclui soluções de armazenamento modernas e tradicionais, incluindo arrays all-flash, arquivos de expansão, plataformas de objetos, infraestrutura hiperconvergente, e serviços de armazenamento de dados. e armazenamento definido por software. Seu segmento CSG oferece computadores pessoais (PCs) de marca, incluindo notebooks, desktops e estações de trabalho e periféricos de marca que incluem monitores, docking stations, teclados, Mouses e dispositivos de we', 'Round Rock, TX, United States', 108000);\n
